import React from 'react';

function Navbar() {
  return (

    <header id="navbar">
      <nav>
        <ul>
          <li><a href="#">home</a></li>
          <li><a href="#about">about</a></li>
          <li><a href="#experience">experience</a></li>
          <li><a href="#projects">projects</a></li>
          <li><a href="#contact">contact</a></li>
        </ul>
      </nav>
    </header>

  );
}

export default Navbar;
